import React from "react";

function Footer() {
    return (
        <div>
            <section class="colored-section footer-section">
                <img class="facebook-logo" src="facebook.png" alt="facebook" />
                <img class="instagram-logo" src="instagram.png" alt="instagram" />
                <img class="discord-logo" src="discord.png" alt="discord" />
                <h1 class="footer-title"> EcoHacks </h1>
            </section>
        </div>
    );
}

export default Footer;
